import styled from "styled-components";
import Post from "./Post";

const TemplateBlock = styled.div`
  padding-top: 1.11rem;
  box-sizing: border-box;
  background: #010101;
  display: flex;
  align-items: center;
  justify-content: center;
  flex-flow: row wrap;
`;

const PostTemplate = ({ shows }) => {
  return (
    <TemplateBlock>
      {shows.map((show) => {
        <Post
          show_name={show.show_name}
          show_artist={show.show_artist}
          show_search={show.show_search}
          show_term={show.show_term}
          show_num={show.show_num}
          show_city={show.show_city}
          show_place={show.show_place}
          show_place_eng={show.show_place_eng}
          show_place_detail={show.show_place_detail}
          show_price={show.show_price}
          show_link={show.show_link}
          show_hashtag={show.show_hashtag}
          show_imgs={show.show_imgs}
        />;
      })}
    </TemplateBlock>
  );
};

export default PostTemplate;
